import React from "react";
import { MDBTable, MDBTableHead, MDBTableBody } from "mdbreact";

const DataTable = ({ data = [] }) => {
  const handleDelete = async (hashId) => {
    try {
      await deleteHash(hashId);
      setHashData((prev) => prev.filter((hash) => hash.id !== hashId));
    } catch (error) {
      // Handle error (e.g., token expiration or other API issues)
    }
  };

  const handleEdit = async (hashId) => {
    try {
      const updatedHash = await editHash(hashId, hashValue, description);
      setHashData((prev) =>
        prev.map((hash) => (hash.id === hashId ? updatedHash : hash))
      );
    } catch (error) {
      // Handle error (e.g., token expiration or other API issues)
    }
  };

  return data && data.length > 0 ? (
    <div className="d-flex align-items-center justify-content-center mt-5">
      <MDBTable>
        <MDBTableHead>
          <tr>
            <th>Hash Value</th>
            <th>Description</th>
            <th>Actions</th>
          </tr>
        </MDBTableHead>
        <MDBTableBody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.hash_value}</td>
              <td>{item.description}</td>
              <td>
                <div className="btn-group" role="group">
                  <button
                    type="button"
                    className="btn btn-secondary"
                    onClick={() => {
                      console.log("hola");
                    }}
                  >
                    Edit
                  </button>
                  <button
                    type="button"
                    className="btn btn-danger"
                    onClick={() => {
                      console.log("hola");
                    }}
                  >
                    Delete
                  </button>
                </div>
              </td>
            </tr>
          ))}
        </MDBTableBody>
      </MDBTable>
    </div>
  ) : (
    <div className="d-flex align-items-center justify-content-center mt-5">
      <h1>No hashes stored!</h1>
    </div>
  );
};

export default DataTable;
